import React, { Component } from 'react'
import { Modal, Button } from 'semantic-ui-react';


export default class CreateAssign extends Component {
    render() {
        return (

            <Modal size="mini" trigger={<Button className="ui green button" >Create New Dish +</Button>}>
                <Modal.Header>Create New Assignment</Modal.Header>
                    <Modal.Content >
                       <form className="ui form" onSubmit={this.handleSubmit}>
                            <div className="field">
                                <label>Title</label>
                                <input type="text"  placeholder="title"
                                        name= "title"
                                        value = {this.state.title}
                                        onChange={this.handleChange}
                          />
                            </div>
                            <div className="field">
                                <label>Due Date:</label>
                                <DatePicker 
                                selected={this.state.startDate}
                                onChange={(date ) => this.handleDate(date)}

                                minDate={new Date()}    
                            />
                        </div>

                            <div className="field">
                                <label>Cuisine</label>
                                <input type="text" name="cuisine" placeholder="Assignment Cuisine"
                                    value={this.state.cuisine}
                                    onChange={this.handleInputChange}
                                />
                            </div>
                            <div className="field">
                                <label>Description</label>
                                <textarea rows="3" name="description" placeholder="Assignment Description"
                                    value={this.state.description}
                                    onChange={this.handleInputChange}
                                ></textarea>
                            </div>
                            <div className="field">
                                <label>Assignment Image</label>
                                <input type="text" name="img" placeholder="Assignment Cuisine"
                                    value={this.state.img}
                                    onChange={this.handleInputChange}
                                />
                            </div>
                            <button className="ui button" type="submit">Submit</button>
                        </form>
                   </Modal.Content>
            </Modal>

        )
    }
}
